sqlReaderQuery.value:
@concat(
    'SELECT STUFF((SELECT '','' + c.name FROM sys.columns c ',
    'INNER JOIN sys.tables t ON c.object_id = t.object_id ',
    'INNER JOIN sys.schemas s ON t.schema_id = s.schema_id ',
    'WHERE t.name = ''', item(), ''' AND s.name = ''dbo'' AND (c.name LIKE ''%_SK'' OR c.name = ''NRO_ACTUAL_PRESTACION'') FOR XML PATH('''')), 1, 1, '''') AS ColumnList'
)
